import React from "react";
import { Route, Redirect } from "react-router-dom";

 export const ProtectedRoute = ({ component:Cmp, ...rest }) => (
  <Route
    {...rest}
    render={(props) => 
      localStorage.getItem("admin") ? (
        <Cmp {...props} />
      ) : 
      localStorage.getItem("doctor")?
      <Cmp {...props}/>:
      localStorage.getItem("patient")?
      <Cmp {...props}/>:
      
        <Redirect to="/login" />
      
    }
  />
);

